int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_BOOLEAN) {\n        query += \"char(1) \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_DATE) {\n        query += \"datetime \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_INTEGER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_NUMBER) {\n        query += \"int \";\n      } else {\n        query += \"varchar(512) \";\n      }\n      query += \", \";\n    }\n  }\n\n  // Source identifier.\n  query += \"alfresco_id smallint not null, \";\n  query += \"src_id varchar(255) not null, \";\n\n  // Primary key.\n  query += \"PRIMARY KEY (id), \";\n\n  // Foreign key.\n  query += \"CONSTRAINT FOREIGN KEY (document_id) REFERENCES dm_dim_documents(id) ON DELETE CASCADE, \";\n  query += \"CONSTRAINT FOREIGN KEY (folder_id) REFERENCES dm_dim_folders(id) ON DELETE CASCADE, \";\n  query += \"CONSTRAINT FOREIGN KEY (alfresco_id) REFERENCES dm_dim_alfresco(id) ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \");\";\n\n  return query;\n}\n'),(7766,30,567,0,'jsScript_type',0,NULL),(7767,30,567,0,'field_name',0,'query'),(7768,30,567,0,'field_rename',0,'query'),(7769,30,567,0,'field_type',0,'String'),(7770,30,567,0,'field_length',-1,NULL),(7771,30,567,0,'field_precision',-1,NULL),(7772,30,567,0,'field_replace',0,'N'),(7773,30,567,0,'cluster_schema',0,NULL),(7774,30,567,0,'row_distribution_code',0,NULL),(7775,30,568,0,'PARTITIONING_SCHEMA',0,NULL),(7776,30,568,0,'PARTITIONING_METHOD',0,'none'),(7777,30,568,0,'select_unspecified',0,'N'),(7778,30,568,0,'remove_name',0,'isLastRow'),(7779,30,568,0,'cluster_schema',0,NULL),(7780,30,568,0,'row_distribution_code',0,NULL);
